import React from "react";
import ReactDom from "react-dom";
import App from "./App";
import Details_page from "./Details_page";



function webseries_card_value(value,index,arr){
    return (
        <>
            card_img = {value.card_img}
            links = {value.links}
            title = {value.title}
            headname = {value.headname}
        </>
    );
}


ReactDom.render(
    <>
    <h1 className="head">LIST OF TOP 50 WEB SERIES</h1>
    </>,document.getElementById("root")
);


ReactDom.render(
    <>
    {Details_page.map(webseries_card_value)}
    </>,document.getElementById("root2")
);
